def run(value_list):
    """
    Calculates the percentage change in revenue from external customers from UK in 2019 from 2018.
    """
    uk_2019 = None
    uk_2018 = None
    for item in value_list:
        if item['category'] == 'UK' and item['header2'] == 'Year-ended 31 March 2019':
            uk_2019 = item['number_value']
        if item['header2'] == 'Year-ended 31 March 2018 Restated See note 2':
            uk_2018 = item['number_value']
    if uk_2018 is not None and uk_2019 is not None:
        percentage_change = ((uk_2019 - uk_2018) / uk_2018) * 100
        return (round(percentage_change, 2), 'percent')
    else:
        return (None, '')

def run(value_list):
    """
    Calculates the percentage increase in cash provided from financing activities between 2018 and 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    financing_2018 = None
    financing_2019 = None

    for item in value_list:
        if item['header1'] == 'Net cash (used in) provided by:' and item['header2'] == '2018':
            financing_2018 = item['number_value']
        if item['header1'] == 'Net cash (used in) provided by:' and item['header2'] == '2019':
            financing_2019 = item['number_value']

    if financing_2019 is not None and financing_2018 is not None:
        percentage_change = ((financing_2019 - financing_2018) / financing_2018) * 100
        return (round(percentage_change, 2), 'percent')
    else:
        return (None, '')

def run(value_list):
    """
    Calculates the percentage change in the total expense relating to operating leases from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    # Extract values for 2018 and 2019
    value_2018 = None
    value_2019 = None

    for item in value_list:
        if item['header4'] == '2018':
            value_2018 = item['number_value']
        if item['header4'] == '2019':
            value_2019 = item['number_value']

    # Calculate the percentage change
    if value_2018 is not None and value_2019 is not None:
        percentage_change = ((value_2019 - value_2018) / value_2018) * 100
        return (round(percentage_change, 2), 'percent')
    else:
        return (0.00, '')

def run(value_list):
    """
    Calculates the percentage change in Other for deferred tax assets.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    # Extract the relevant data for 2019 and 2018
    data_2019 = next((d for d in value_list if d['header3'] == '2019'), None)
    data_2018 = next((d for d in value_list if d['header3'] == '2018'), None)

    if data_2019 and data_2018:
        other_2019 = data_2019.get('number_value', 0)
        other_2018 = data_2018.get('number_value', 0)

        if other_2018 != 0:
            percentage_change = ((other_2019 - other_2018) / other_2018) * 100
            return (round(percentage_change, 2), 'percent')
        else:
            return (0.00, 'percent')
    else:
        return (0.00, 'percent')
